    "2016-07-27T22:54:34.170147",nt"name": "narrative-report-valentine-national-wildlife-refuge-january-february-march-and-april-1950",nt"isopen":
    false,nt"url": null,nt"notes": "This narrative report for Valentine NWR
    outlines Refuge accomplishments from January through April of 1950. The report begins
    by summarizing the weather conditions and water conditions during this period. Wildlife-
    including migratory birds, upland game birds, big game animals, furbearers, predators,
    mammals, raptors, and fish- is also covered. The Refuge development and maintenance
    section discusses physical developments. Resource management is outlined; topics
    include grazing, haying, and fur harvesting. The public relations section of the
    report describes recreational uses, Refuge visitors, and violations. N-R forms and
    photographs are attached.",nt"license_title": "License Not Specified",nt"extras":
